import React from 'react';

const SpeciesCard = ({ species }) => {
  return (
    <div className="species-card">
      <img src={species.image} alt={species.name} />
      <h3>{species.name}</h3>
      <p>{species.scientific_name}</p>
      <p>Status: {species.status}</p>
    </div>
  );
};

export default SpeciesCard;
